static
void PrepareElp82bLambdaArray(int nr_of_lambdas,
                              const int max_lambda_factor[],
                              const double lambda[],
                              double cos_sin_lambda[]) {
    /* initialize cos_sin_lambda:
       (cos,sin)(1*lambda[0]),(cos,sin)(-1*lambda[0]),(cos,sin)(2*lambda[0]),...
       (cos,sin)(1*lambda[1]),(cos,sin)(-1*lambda[1]),(cos,sin)(2*lambda[1]),...
    */
  int i,m;
  for (i=0;i<nr_of_lambdas;i++) {
    const int max_factor = max_lambda_factor[i];
    double *cslp = cos_sin_lambda;
    cslp[0] = cos(lambda[i]);
    cslp[1] = sin(lambda[i]);
    cslp[2] =  cslp[0];
    cslp[3] = -cslp[1];
    for (m=2;m<=max_factor;m++) {
        /* addition theorem:
           cos(m*l) = cos(m0*l+m1*l) = cos(m0*l)*cos(m1*l)-sin(m0*l)*sin(m1*l)
           sin(m*l) = sin(m0*l+m1*l) = cos(m0*l)*sin(m1*l)+sin(m0*l)*cos(m1*l)
        */
      const double *m0 = cos_sin_lambda + ((((m+0)>>1)-1)<<2);
      const double *m1 = cos_sin_lambda + ((((m+1)>>1)-1)<<2);
      cslp += 4;
      cslp[0] = m0[0] * m1[0] - m0[1] * m1[1];
      cslp[1] = m0[0] * m1[1] + m0[1] * m1[0];
      cslp[2] =  cslp[0];
      cslp[3] = -cslp[1];
    }
    cos_sin_lambda += (max_factor<<2);
  }
}

static
void AccumulateElp82bTerms(const unsigned char *instructions,
                           const double *coefficients,
                           const double cos_sin_lambda[],
                           double accu[],
                           double *sp) {
    /* Accumulates the series given in instructions/coefficients.
       The argument of the series is cos_sin_lambda which has
       been initialized using PrepareElp82bLambdaArray().
       accu is the output accumulator.
       sp must point to a memory area holding 2*nr_of_lambdas double.
       area must be supplied by the caller, it will be destroyed during the
       calculation.
    */
  sp[0] = 1.0;
  sp[1] = 0.0;
  for (;;) {
    int term_count = *instructions++;
    if (term_count < 0xFE) {
      const int lambda_index = ((term_count&15)<<8)|(*instructions++);
        /* calculate new argument and push it on the stack */
      const double *const cos_sin = cos_sin_lambda + (lambda_index<<1);
      sp[2] = cos_sin[0]*sp[0] - cos_sin[1]*sp[1];
      sp[3] = cos_sin[0]*sp[1] + cos_sin[1]*sp[0];
      sp += 2;
      term_count >>= 4;
      while (--term_count >= 0) {
        accu[*instructions++] += (coefficients[0]*sp[0]
                                + coefficients[1]*sp[1]);
        coefficients += 2;
      }
    } else {
      if (term_count == 0xFF) break;
        /* pop argument from the stack */
      sp -= 2;
    }
  }
}

